column8:
●中硬のゴムと硬めのプラスティックを組み合わせたハンマーです。●敷石の外構工事や自動車のボディワークなどに最適です。●ボルトを締め付ける時は既定のトルクを守ってください。●柔らかいゴムと中硬のポリエチレン製のインサートを組み合わせたハンマーです。●ボルト一本で全てが固定されているのでインサートやハンドルの交換が容易です。●8種類のインサートから用途に適したものを選んで交換できます。●1938年にドイツで特許を取得した世界に類のない構造のハンマーです。<BR>●頭径(mm):40●頭長(mm):110●全長(mm):330●質量(g):640<BR>●可鍛鋳鉄製ハウジング、木製ハンドル<BR>●ヘッド:ゴム（黒）、プラスティック（赤）●柄:アカシア<BR><tr><td colspan="2">
<center><img src="https://image.rakuten.co.jp/parts/cabinet/design/2017summertire2.jpg" border="0" width="800px"><br>
</td></tr></center>


